import AppLayout from "../components/AppLayout";
import More from "../components/more";

const profileMore = () => {
    return(
        <AppLayout>
           <More header="팔로잉"/>
           <More header="팔로워"/>
        </AppLayout>
    );
};

export default profileMore;
